import React from "react";
import { Route, Routes } from "react-router-dom";
import "./Nav.css";
const Nav = () => {
    return (
        <div className="nav">
            <Routes>
                <Route exact path="/" element={<Home />} />
                <Route></Route>
                <Route></Route>
            </Routes>
        </div>
    );
};

export default Nav;
